MICROSOFT OFFICE OUTLOOK 2007

Microsoft Office Outlook 2007 provides an integrated solution for managing your 
time and information, connecting across boundaries, and remaining in control of 
the information that reaches you. Office Outlook 2007 delivers innovations you 
can use to quickly search your communications, organize your work, and better 
share your information with others all from one place.

